(592, 'wpforms_notifications', 'a:4:{s:6:\"update\";i:1642767783;s:4:\"feed\";a:5:{i:0;a:6:{s:5:\"title\";s:38:\"User Registration Just Got 10X Better!\";s:7:\"content\";s:305:\"Our User Registration addon got a HUGE upgrade! Now Pro customers can register new users on ANY form, create password reset forms, edit registration emails easily, use conditional logic for user registrations, and much more! PLUS: We added 3 new form templates for this addon so you can get started today!\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:132;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:190:\"https://wpforms.com/introducing-the-updated-user-registration-addon/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=User Registration Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:168:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=User Registration Lite Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2021-12-20 00:00:00\";}i:1;a:6:{s:5:\"title\";s:41:\"NEW! Save and Resume Addon in WPForms Pro\";s:7:\"content\";s:261:\"The NEW Save and Resume addon is available now in WPForms Pro! Let your visitors save progress and easily resume their entry later. Users can complete the entry themselves or share the link via email. Upgrade to WPForms Pro today to start using Save and Resume!\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:112;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:194:\"https://wpforms.com/introducing-the-new-save-and-resume-addon-for-wpforms/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Save and Resume Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:166:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Save and Resume Lite Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2021-10-28 10:00:00\";}i:2;a:6:{s:5:\"title\";s:52:\"NEW! Rich Text Field + Uncanny Automator Integration\";s:7:\"content\";s:351:\"Our new Rich Text field is now live in WPForms Pro! Get fully formatted entries with bold, headings, images, links, and more. Rich text is perfect for blog post submissions and you can let visitors preview their layout before submitting. PLUS: our new Uncanny Automator integration makes it easy to use your forms to trigger your own custom workflows.\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:107;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:188:\"https://wpforms.com/introducing-wpforms-1-7-0-rich-text-uncanny-automator/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Rich Text Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:160:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Rich Text Lite Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2021-10-11 00:00:00\";}i:3;a:6:{s:5:\"title\";s:123:\"Now available in WPForms Pro! Accept payments with Square and start making more money through your websites forms today.\";s:7:\"content\";s:316:\"Its now easier than ever to take payments through your forms. With our new Square addon, WPForms Pro users can accept orders online using one of the worlds most popular payment service providers. Easily process credit card transactions through your Square account right on your website, with just a few clicks!\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:94;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:176:\"https://wpforms.com/introducing-the-new-square-addon-for-wpforms/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Square Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:157:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Square Lite Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2021-09-14 00:00:00\";}i:4;a:6:{s:5:\"title\";s:99:\"New Features: Entry Preview Field for Multi-Step Forms + Improved Entry Search & Keyboard Shortcuts\";s:7:\"content\";s:405:\"Our most requested feature, Entry Preview field, is finally here. This is super helpful for multi-step forms and mission-critical forms where you want to avoid typos and inaccurate details. It lets users preview all form information before they click the submit button. Plus, we also improved our Entry Management by adding better search filters, and we added keyboard shortcuts to speed up your workflow.\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:88;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:213:\"https://wpforms.com/announcing-the-new-entry-preview-field-added-entry-editing-features-wpforms-1-6-9/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=WPForms 169 Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:157:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=WPForms 169 Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2021-08-26 00:00:00\";}}s:6:\"events\";a:0:{}s:9:\"dismissed\";a:0:{}}', 'yes'),
