(587, 294, '_elementor_data', '[{\"id\":\"94f6bd8\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"1972349\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"55a5b9f\",\"elType\":\"widget\",\"settings\":{\"title\":\"Manfaat dari aplikasi Service-go \"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"06a7327\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"6882ee8\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"0814e4e\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>&nbsp;Secara tidak langsung sangatlah berguna untuk membantu orang lain dengan cara mempesan menggunakan aplikasi service-go ini.&nbsp; setelah itu secara sistem akan diberikan beberapa pilihan bengkel yang sesuai dengan kebutuhan pengguna. nah mekanik \\/ montir akan&nbsp; datang sesuai dengan jadwal dan lokasi yang anda inginkan. Selagi juga harga yang terjangkau dengan model transaksi via CASH bisa atau via online bisa misal Pakai GOPAY.<br><\\/p>\\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dari sini juga kita mengetahui bahwa saat seseorang \\/ warga sulit menemukan bantuan terutama pada malam hari, sebenernya memang ada bantuan tapi tak jarang juga gak semua orang mau membantu karena saya juga pernah mengalaminya sendiri bahwa sulit meminta pertolongan saat malam hari.&nbsp; juga pernah mewawancari orang lain dan faktanya valid dari beberapa orang yang saya wawancari tersebut juga bilang sangat sulit meminta pertolongan Mungkin seperti ban yang bocor atau mesin yang mogok oleh karena itu Aplikasi Service-Go membuat jasa layanan service online yang tersedia dengan&nbsp; keterangan waktu dan tempat kejadian, mengidentifikasi penyebab kerusakan terutama kepada pengendara roda dua. <br><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"bu71rau\",\"elType\":\"sect