(1711, 815, '_elementor_data', '[{\"id\":\"44d5f76\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"74678a9\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"c181381\",\"elType\":\"widget\",\"settings\":{\"title\":\"Semangat  Terus Service-GO\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"4351d51\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"1065a9e\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"28211f2\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Assalamualaikum Wr.Wb, Perkenalan kami dari team Service-GO yang ingin juga bisa bermanfaat untuk orang lain dengan dukungan dunia IT dan era Teknologi Informasi jaman sekarang.<br>Berawal dari sebuah layanan jasa Service-GO ini kami disini adalah Seorang mahasiswa&nbsp; semester 5&nbsp; Jurusan SIstem Informasi. yang membuat Webiste ini untuk tugas akhir Mata Kuliah APLIKASI E-BISNIS yang dimana kita bukan hanya belajar tentang bisnis saja namun belajar tentang hal yang sangatlah luas yang dipelajari. Maka dari itu Kelompok kami membuat sebuah ide Layanan Service Online yang bertujuan untuk memudahkan sesama manusia saat terjadi masalah di jalan raya terutama yang menggunakan fasilitas kendaraan yang sepeda motor. <\\/p>\\n<p>Karena tugas akhir ini merupakan untuk UJIAN AKHIR SEMSTER bila ada kekurangan dalam penyampaikan saran atau fitur yang di buat dalam Aplikasi service-go Mohon maaf karena juga masih dalam bimbingan belajar,&nbsp; Dan semoga selalu bisa bermanfaat untuk orang lain Karena dengan adanya Service-Go pasti ada Jalan keluarnya. <\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"n3byb0y\",\"elType\":\"section\",\"settings\":{\"css_classes\":\"attorneys-boxes\"},\"elements\":[{\"id\":\"gjcp8pe\",\"elType\":\"column\",\"settings\":{\"_column_size\"