(294, 1, '2016-11-03 16:50:09', '2016-11-03 16:50:09', '<style>/*! elementor - v3.5.3 - 28-12-2021 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>Manfaat dari aplikasi Service-go </h2>		\n		<p>&nbsp;Secara tidak langsung sangatlah berguna untuk membantu orang lain dengan cara mempesan menggunakan aplikasi service-go ini.&nbsp; setelah itu secara sistem akan diberikan beberapa pilihan bengkel yang sesuai dengan kebutuhan pengguna. nah mekanik / montir akan&nbsp; datang sesuai dengan jadwal dan lokasi yang anda inginkan. Selagi juga harga yang terjangkau dengan model transaksi via CASH bisa atau via online bisa misal Pakai GOPAY.<br></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dari sini juga kita mengetahui bahwa saat seseorang / warga sulit menemukan bantuan terutama pada malam hari, sebenernya memang ada bantuan tapi tak jarang juga gak semua orang mau membantu karena saya juga pernah mengalaminya sendiri bahwa sulit meminta pertolongan saat malam hari.&nbsp; juga pernah mewawancari orang lain dan faktanya valid dari beberapa orang yang saya wawancari tersebut juga bilang sangat sulit meminta pertolongan Mungkin seperti ban yang bocor atau mesin yang mogok oleh karena itu Aplikasi Service-Go membuat jasa layanan service online yang tersedia dengan&nbsp; keterangan waktu dan tempat kejadian, mengidentifikasi penyebab kerusakan terutama kepada pengendara roda dua. <br></p>		\n			<style>/*! elementor - v3.5.3 - 28-12-2021 */\n.elementor-widget-image-box .elementor-image-box-content{width:100%}@media (min-width:768px){.elementor-widget-image-box.elementor-position-left .elementor-image-box-wrapper,.elementor-widget-image-box.elementor-position-right .elementor-image-box-wrapper{display:-webkit-box;display:-ms-flexbox;display:flex}.elementor-widget-image-box.elementor-position-right .elementor-image-box-wrapper{text-align:right;-webkit-box-orient:horizontal;-webkit-box-direction:reverse;-ms-flex-direction:row-reverse;flex-direction:row-reverse}.elementor-widget-image-box.elementor-position-left .elementor-image-box-wrapper{text-align:left;-webkit-box-orient:horizontal;-webkit-box-direction:normal;-ms-flex-direction:row;flex-direction:row}.elementor-widget-image-box.elementor-position-top .elementor-image-box-img{margin:auto}.elementor-widget-image-box.elementor-vertical-align-top .elementor-image-box-wrapper{-webkit-box-align:start;-ms-flex-align:start;align-items:flex-start}.elementor-widget-image-box.elementor-vertical-align-middle .elementor-image-box-wrapper{-webkit-box-align:center;-ms-flex-align:center;align-items:center}.elementor-widget-image-box.elementor-vertical-align-bottom .elementor-image-box-wrapper{-webkit-box-align:end;-ms-flex-align:end;align-items:flex-end}}@media (max-width:767px){.elementor-widget-image-box .elementor-image-box-img{margin-left:auto!important;margin-right:auto!important;margin-bottom:15px}}.elementor-widget-image-box .elementor-image-box-img{display:inline-block}.elementor-widget-image-box .elementor-image-box-title a{color:inherit}.elementor-widget-image-box .elementor-image-box-wrapper{text-align:center}.elementor-widget-image-box .elementor-image-box-description{margin:0}</style><figure><a href=\"#\"><img width=\"653\" height=\"366\" src=\"http://localhost/wordpress/wp-content/uploads/2022/01/servis-motor.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h3><a href=\"#\">Kerusakan pada mesin motor</a></h3>		\n			<figure><a href=\"#\"><img width=\"450\" height=\"338\" src=\"http://localhost/wordpress/wp-content/uploads/2022/01/ban_bocor.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h3><a href=\"#\">Menambal ban yang bocor ataupun yang tertancap paku</a></h3>		\n			<figure><a href=\"#\"><img width=\"678\" height=\"453\" src=\"http://localhost/wordpress/wp-content/uploads/2022/01/knalpot-bocor.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h3><a href=\"#\">Kerusakan terhadap knalpot yang bocor sehingga menyebabkan suatu masalah</a></h3>', 'Layanan', '', 'publish', 'closed', 'closed', '', 'practice-areas', '', '', '2022-01-21 12:32:55', '2022-01-21 12:32:55', '', 0, 'http://lawyer2.mythemecloud.io/?page_id=294', 0, 'page', '', 0),
(339, 1, '2016-11-03 17:37:59', '2016-11-03 17:37:59', '<style>/*! elementor - v3.5.3 - 28-12-2021 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>Semangat  Terus Service-GO</h2>		\n		<p>Assalamualaikum Wr.Wb, Perkenalan kami dari team Service-GO yang ingin juga bisa bermanfaat untuk orang lain dengan dukungan dunia IT dan era Teknologi Informasi jaman sekarang.<br>Berawal dari sebuah layanan jasa Service-GO ini kami disini adalah Seorang mahasiswa&nbsp; semester 5&nbsp; Jurusan SIstem Informasi. yang membuat Webiste ini untuk tugas akhir Mata Kuliah APLIKASI E-BISNIS yang dimana kita bukan hanya belajar tentang bisnis saja namun belajar tentang hal yang sangatlah luas yang dipelajari. Maka dari itu Kelompok kami membuat sebuah ide Layanan Service Online yang bertujuan untuk memudahkan sesama manusia saat terjadi masalah di jalan raya terutama yang menggunakan fasilitas kendaraan sepeda motor. </p>\n<p>Karena tugas akhir ini merupakan untuk UJIAN AKHIR SEMSTER bila ada kekurangan dalam penyampaikan saran atau fitur yang di buat dalam Aplikasi service-go Mohon maaf karena juga masih dalam bimbingan belajar,&nbsp; Dan semoga selalu bisa bermanfaat untuk orang lain Karena dengan adanya Service-Go pasti ada Jalan keluarnya. </p>		\n			<style>/*! elementor - v3.5.3 - 28-12-2021 */\n.elementor-widget-divider{--divider-border-style:none;--divider-border-width:1px;--divider-color:#2c2c2c;--divider-i