entor - v3.5.3 - 28-12-2021 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"300\" height=\"300\" src=\"http://localhost/wordpress/wp-content/uploads/2022/01/Instagram-Post-13-3.png\" alt=\"\" loading=\"lazy\" />															\n			<figure><a href=\"#\"><img width=\"450\" height=\"338\" src=\"http://localhost/wordpress/wp-content/uploads/2022/01/ban_bocor.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h3><a href=\"#\">Menambal ban yang bocor ataupun yang tertancap paku</a></h3>		\n			<figure><a href=\"#\"><img width=\"678\" height=\"453\" src=\"http://localhost/wordpress/wp-content/uploads/2022/01/knalpot-bocor.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h3><a href=\"#\">Kerusakan terhadap knalpot yang bocor sehingga menyebabkan suatu masalah</a></h3>', 'Layanan', '', 'inherit', 'closed', 'closed', '', '294-revision-v1', '', '', '2022-01-19 22:51:37', '2022-01-19 22:51:37', '', 294, 'http://localhost/wordpress/?p=758', 0, 'revision', '', 0),
