(815, 1, '2022-01-21 06:58:14', '2022-01-21 06:58:14', '<style>/*! elementor - v3.5.3 - 28-12-2021 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>Semangat  Terus Service-GO</h2>		\n		<p>Assalamualaikum Wr.Wb, Perkenalan kami dari team Service-GO yang ingin juga bisa bermanfaat untuk orang lain dengan dukungan dunia IT dan era Teknologi Informasi jaman sekarang.<br>Berawal dari sebuah layanan jasa Service-GO ini kami disini adalah Seorang mahasiswa&nbsp; semester 5&nbsp; Jurusan SIstem Informasi. yang membuat Webiste ini untuk tugas akhir Mata Kuliah APLIKASI E-BISNIS yang dimana kita bukan hanya belajar tentang bisnis saja namun belajar tentang hal yang sangatlah luas yang dipelajari. Maka dari itu Kelompok kami membuat sebuah ide Layanan Service Online yang bertujuan untuk memudahkan sesama manusia saat terjadi masalah di jalan raya terutama yang menggunakan fasilitas kendaraan yang sepeda motor. </p>\n<p>Karena tugas akhir ini merupakan untuk UJIAN AKHIR SEMSTER bila ada kekurangan dalam penyampaikan saran atau fitur yang di buat dalam Aplikasi service-go Mohon maaf karena juga masih dalam bimbingan belajar,&nbsp; Dan semoga selalu bisa bermanfaat untuk orang lain Karena dengan adanya Service-Go pasti ada Jalan keluarnya. </p>		\n			<style>/*! elementor - v3.5.3 - 28-12-2021 */\n.elementor-widget-divider{--divider-border-style:none;--divider-border-width:1px;--divider-color:#2c2c2c;--divi